using NUnit.Framework;

namespace GraphTheory.Tests
{
    public class SimilarStringGroupsTests
    {
        [Test]
        public void Test1()
        {
            var result = SimilarStringGroups.NumSimilarGroups(new[] { "tars", "rats", "arts", "star" });

            Assert.AreEqual(2, result);
        }

        [Test]
        public void Test2()
        {
            var result = SimilarStringGroups.NumSimilarGroups(new[] { "omv", "ovm" });

            Assert.AreEqual(1, result);
        }

        [Test]
        public void Test3()
        {
            var result = SimilarStringGroups.NumSimilarGroups(new[] { "koqnn", "knnqo", "noqnk", "nqkon" });

            Assert.AreEqual(3, result);
        }

